import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

// pages
import Home from "./pages/Home";
import Create from "./pages/Create";
import Update from "./pages/Update";

import { Signup } from "./components/Signup";
import { Login } from "./components/Login";
import { Dashboard } from "./components/profileDashboard";
import { AuthProvider } from "./context/Auth";

function App() {
  return (
    <BrowserRouter>
      <AuthProvider>
        <nav>
          <h1>Supa Smoothies</h1>
          <Link to="/">Home</Link>
          <Link to="/create">Create New Smoothie</Link>
          <Link to="/components/Login">Login</Link>
          <Link to="/components/Signup">Signup</Link>
          <Link to="/components/Dashboard">Dashboard</Link>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/create" element={<Create />} />
          <Route path="/:id" element={<Update />} />
          <Route path="/components/Login" element={<Login />} />
          <Route path="/components/Signup" element={<Signup />} />
          <Route path="/components/Dashboard" element={<Dashboard />} />
        </Routes>
      </AuthProvider>
    </BrowserRouter>
  );
}

export default App;
